package com.demo;

public class table {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int num = 1 ;
		for(int i=1;i<=10;i++)
        {
			for(int j=2;j<=10;j++)
			{
				num = i*j;
				System.out.println(num+" ");			
				}
		
		System.out.println(" ");
        }
}
}
